import React from "react";

const Komentar = () => {
  return (
    <div style={{ marginLeft: "20px" }}>
      <img
        src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.researchgate.net%2Fpublication%2F353452647_Preliminary_Investigation_on_Neutronic_Performance_of_Pu-started_One_Fluid-Molten_Salt_Reactor_OF-MSR&psig=AOvVaw32rYmyrBDqaQkb_wpy-l7V&ust=1692017281617000&source=images&cd=vfe&opi=89978449&ved=0CBEQjRxqFwoTCOjfidvV2YADFQAAAAAdAAAAABAE"
        alt="poto"
      />{" "}
      <p style={{ marginLeft: "30px", fontWeight: "bold" }}>John Doe</p>
    </div>
  );
};

export default Komentar;
